import React, { Component } from "react";

class UserDetail extends Component {
  render() {
    return (
      <div>
        <p>This is the User Detail Component</p>

        <li>Date of Birth: {this.props.userData.fName}</li>
      </div>
    );
  }
}

export default UserDetail;
